import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { ServiceCallsService } from 'src/app/services/service-calls.service';

@Component({
  selector: 'app-specific-application',
  templateUrl: './specific-application.component.html',
  styleUrls: ['./specific-application.component.css']
})
export class SpecificApplicationComponent implements OnInit {
  public customerid = Number.parseInt(JSON.stringify(this.service.userid)) //number
  public data1:any;
  public customerData1:any;
  constructor(private router:Router, private route:ActivatedRoute, private service:ServiceCallsService) { }

  async ngOnInit(): Promise<void> {
    console.log(this.customerid)
    this.data1 = await this.service.applicationById(Number.parseInt(this.route.snapshot.paramMap.get("id")!));
    this.customerData1 = await this.service.customerData(this.customerid);

  }

}
<head>
    <title>View Specific Application</title>
    <style>
        .one{
             position:relative;
            margin-left:27%;
            font-size: 25px;
         }       
        .two{
           flex-direction: column;
        } 
        .two label {
             margin: 20px 20px 20px 20px;
       }
       .demo1{
            width: 480px;
            height: 330px;
            border: 1px solid black;
            float:right;
            line-height: 1.2;
            padding:3px;
       }
       .demo1 label{
           margin: 10px 40px 40px 40px;
       }
       .demo2{
           width: 480px;
             height: 260px;
             border: 1px solid black;
           float:right;
           line-height: 1.2;
           padding:3px;

       }.demo2 label{
           margin: 10px 40px 40px 40px;
       }
       .demo3{
           width: 300px;
             height: 109px;
             border: 1px solid black;
           padding: 3px;
           box-sizing: border-box;
           float:left;
           position:relative; left:10px; 
       }
       .demo3label{
       float:left;
       }
       .demo4{
           width: 850px;
           height: 365px;
           border: 1px solid black;
           padding: 3px;
           line-height: 0.5;
           float:right;
           position:relative; left:35px; top:47px;
       }.demo4 label{
           margin: 10px 45px 30px 45px;
       }

    </style>
</head>
<body>

<div class="one">
       Application ID :  {{data1?.applicationId}}<br/>
       Application Status : {{data1?.applicationStatus}}<br/>
       Score : {{data1?.score}}<br/>
       Decline Reason : {{data1?.declineReason}}<br/>          
</div>

<h3>Original Application</h3>
<hr height="2px">
<br/>
<div >
   <form class="two" >
       <label> First Name </label>
             <input type="text" value="{{customerData1?.firstName}}" readonly>
        <span style="margin-left:85px">Address</span>
        <span class="demo1">
            <label>Address Line 1 </label>
             <input type="text" value="{{customerData1?.address.addressLine1}}" readonly>
           <br/>
           <label>Address Line 2 </label>
             <input type="text" value="{{customerData1?.address.addressLine2}}" readonly>
           <br/>
           <label>City </label>
             <input type="text" value="{{customerData1?.address.city}}" readonly>
           <br/>
           <label>State </label>
             <input type="text" value="{{customerData1?.address.state}}" readonly>
           <br/>
           <label>Postal Code </label>
             <input type="text" value="{{customerData1?.address.postalCode}}" readonly>
        </span> 
        <br/> <br/>
         <label>Middle Name </label>  
             <input type="text" value="{{customerData1?.middleName}}" readonly>
        <br/><br/>
       <label>Last Name </label>
             <input type="text" value="{{customerData1?.lastName}}" readonly>  
       <br/><br/>    
         <label>Date of Birth </label>  
             <input type="date" value="{{customerData1?.dateOfBirth}}" readonly >
        <br/><br/> 
        <label>Marital Status </label>
             <input type="text" value="{{customerData1?.maritalStatus}}" readonly>
        <span style="margin-left:380px">Contact Information</span>  
        <span class="demo2">
            <label>Home Phone  </label>
             <input type="text" value="{{customerData1?.homePhone}}" readonly>
           <br/>
           <label>Office Phone </label>
             <input type="text" value="{{customerData1?.officePhone}}" readonly>
           <br/>
           <label>Mobile </label>
             <input type="text" value="{{customerData1?.mobile}}" readonly>
           <br/>
           <label>Email Address</label>
             <input type="text" value="{{customerData1?.emailAddress}}" readonly>
        </span> 
        <br/> 
        <label>SSN Number </label>  
             <input type="text" value="{{customerData1?.ssnNumber}}" readonly>
        <br/><br/>
       <label>Loan Amount </label>
             <input type="text" value="{{data1?.loanAmount}}" readonly>  
       <br/><br/>    
         <label>Loan Purpose </label>  
             <input type="text" value="{{data1?.loanPurpose}}" readonly >
        <br/><br/>
